Mikayla is wearing the new #AstarsMX22 Racer Tactical gear set. This kit is produced with a slightly more relaxed fit yet still maintaining its performance comfort and durability. 

#AlpinestarsMX #AlpinestarsProtects #MX #Racer #AlpinestarsRacer #AlpinestarsWomen

@jeffrey_herlings84 was voted “Best Rider” of @mxgp this past weekend in Latvia. Jeffrey went 1-4 for the weekend. 

@romainfebvre finished P4 overall with a P3 in race 2. 

In MX2 it was @maximerenaux959 with his first 1-1 finish!  @jagogeerts93 finished P2 with a 3-2 for The Weeknd. 

All riders have a small break and then head to Turkey for the next  round September 5th. 

